	add("muslin", "{\"term\":\"muslin\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Italian\"], \"text\":\"From French \u0027mousseline\u0027 from Italian \u0027mussolina\u0027 from \u0027mussolo\u0027 (lang\u003dit) that is Mosul in northern Iraq (compare \u0027\u00271875 Knight, Edward H.\u0027\u0027, \u0027Knight\u0027s American Mechanical Dictionary\u0027, V2 p1502: \u0026quot;Muslins are so called from Moussol in India.\u0026quot;)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several varieties of thin cotton cloth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1875\u0027\u0027, Edward H. Knight, \u0027Knight\u0027s American Mechanical Dictionary\u0027, Vol.2 p.1502\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A bleached or unbleached thin white cotton cloth, unprinted and undyed. [Nineteen varieties are thereafter listed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"It was April 22, 1831, and a young man was walking down Whitehall in the direction of Parliament Street. He wore shepherd\u0027s plaid trousers and the swallow-tail coat of the day, with a figured \u0027\u0027muslin\u0027\u0027 cravat wound about his wide-spread collar\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Fabric made of cotton, flax (linen), hemp, or silk, finely or coarsely woven\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1875\u0027\u0027, Edward H. Knight, \u0027Knight\u0027s American Mechanical Dictionary\u0027, Vol.2 pp.1502\u0026amp;minus;3\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Other very different styles of fabric are now indifferently called \u0027\u0027muslins\u0027\u0027, and the term is used differently on the respective sides of the Atlantic\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A term used for a wide variety of tightly-woven thin fabrics, especially those used for bedlinen. \u0026lt;!--Its use for \u0027cotton\u0027 is modern; the word \u0027linen\u0027 in \u0027bedlinens\u0027 [sic] is the clue.--\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Woven cotton or linen fabrics, especially when used for items other than garments\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A dressmaker\u0027s pattern made from inexpensive cloth for fitting\", \"priority\":10}]}, \"synonyms\":{}}");

