	add("mustache", "{\"term\":\"mustache\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Italian\"], \"text\":\"From French {{m|fr|moustache}}, from Italian {{m|it|mostaccio}}, from {{m|el|μουστάκιον}}, diminutive of (Doric) Ancient greek (to 1453) {{m|grc|μύσταξ||upper lip}}, from Proto-indo-european {{m|ine-pro|*mendʰ-||to chew}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A growth of facial hair between the nose and the upper lip\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"“My Continental prominence is improving,” I commented dryly. ¶ Von Lindowe cut at a furze bush with his silver-mounted rattan. ¶ “Quite so,” he said as dryly, his hand at his \u0027\u0027mustache\u0027\u0027. “I may say if your intentions were known your life would not be worth a curse.”\", \"priority\":2}]}, \"synonyms\":{}}");

	add("mustard", "{\"term\":\"mustard\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027moustarde\u0027 (French: \u0027moutarde\u0027 , from \u0027moust\u0027 (must) from Latin \u0027mustum\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plant of certain species of the genus \u0027Brassica\u0027, or of related genera (especially \u0027Sinapis alba\u0027, in the family Brassicaceae, with yellow flowers, and linear seed pods\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Powder or paste made from seeds of the mustard plant, and used as a condiment or a spice\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When the waitress brought the food I asked her if she had any Dijon \u0027\u0027mustard\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The leaves of the mustard plant, used as a salad\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Mustard\u0027\u0027 and cress sandwiches\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Dark yellow colour, the colour of mustard\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The tomalley of a crab, which resembles the condiment\", \"priority\":7}]}, \"synonyms\":{}}");

	add("muster", "{\"term\":\"muster\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) from Anglo-norman \u0027mostrer\u0027 Middle french (ca. 1400-1600) \u0027monstrer\u0027 \u0027moustrer\u0027 (whence the noun \u0027monstre\u0027 which gave the English noun), from Latin {{m|la|mōnstrāre||to show}}, from \u0027monere\u0027 (to admonish)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Gathering\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An assemblage or display; a gathering, collection of people or things\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1743\u0027\u0027, Joseph Steele \u0026amp; Richard Addison, \u0027The Lucubrations of Isaac Bickerstaff, Esq\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"She seems to hear the Repetition of his Mens Names with Admiration; and waits only to answer him with as false a \u0027\u0027Muster\u0027\u0027 of Lovers\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Of the temporal grandees of the realm, and of their wives and daughters, the \u0027\u0027muster\u0027\u0027 was great and splendid\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027, Commonwealth Bureau of Census and Statistics, \u0027Official Year Book of the Commonwealth of Australia\u0027, Issue 13\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The figures from 1788 to 1825 inclusive, as already mentioned, are based on the \u0027\u0027musters\u0027\u0027 taken in those years; those for subsequent years are based upon estimates made on the basis of Census results and the annual\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An assembling or review of troops, as for parade, verification of numbers, inspection, exercise, or introduction into service\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1598\u0027\u0027, William Shakespeare, \u0027King Henry IV, Part 1\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Come, let vs take a \u0027\u0027muster\u0027\u0027 speedily: / Doomesday is neere; dye all, dye merrily\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1663\u0027\u0027, Samuel Pepys, \u0027Diary\u0027, 4 Jul 1663\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"And after long being there, I \u0027light, and walked to the place where the King, Duke \u0026amp;c., did stand to see the horse and foot march by and discharge their guns, to show a French Marquisse (for whom this \u0027\u0027muster\u0027\u0027 was caused) the goodness of our firemen\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The sum total of an army when assembled for review and inspection; the whole number of effective men in an army\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Wycli\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027muster\u0027\u0027 was thirty thousands of men\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Hooke\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Ye publish the \u0027\u0027musters\u0027\u0027 of your own bands, and proclaim them to amount of thousands\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A roundup of livestock for inspection, branding, drenching, shearing etc\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, John Gilfoyle, \u0027Bloody Jackaroos!\u0027, Boolarong Press\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"McGuire took the two of them out to Kidman\u0027s Bore on the Sylvester River where about two dozen stockmen from different stations had gathered to tend the \u0027\u0027muster\u0027\u0027 along the edge of the Simpson Desert\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Showing\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"Something shown for imitation; a pattern\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"An act of showing something; a display\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"1590\u0027\u0027, Sir Philip Sidney, \u0027Arcadia\u0027, Book III\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"Thus all things being condignely ordered, will an ill favoured impatiencie he waited, until the next morning he might make a \u0027\u0027muster\u0027\u0027 of him selfe in the Iland\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"1647\u0027\u0027, Beaumont and Fletcher, \u0027The Queen of Corinth\u0027, Act 2\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"And when you find your women\u0027s favour fail, / \u0027Tis ten to one you\u0027ll know yourself, and seek me, / Upon a better \u0027\u0027muster\u0027\u0027 of your manners\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"A collection of peafowl (an invented term rather than one used by zoologists\", \"priority\":29}]}, \"synonyms\":{}}");

